import React from "react";

function BattleTracker() {
  const data = [
    { name: "qwe", hp: 20 },
    { name: "asd", hp: 15 },
  ];
  return (
    <div>
      {data.map((item, index) => (
        <div key={index}>
          <h1>{item.name}</h1>
          <h1>{item.hp}</h1>
        </div>
      ))}
    </div>
  );
}

export default BattleTracker;
